  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Arctic
  National Wildlife Range outlines Range accomplishments during the 1970 calendar
  year.  The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  mammals, and raptors- is also covered. Resource management is outlined; topics include
  fur harvesting. The public relations section of the report describes recreational
  uses, hunting, fishing, and safety. Items of interest, N-R forms, and photographs
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
